import React from 'react'

// this is a card component used in skills page 
const Card = (props) => {
  return (
    <div >
      <div className="card mt-5 ms-5" style={{width: '18rem'}}>
  <img src={props.img} className="card-img-top" alt="error" />
  <div className="card-body">
    <p className="card-text">{props.name}</p>
  </div>
</div>
    </div>
  )
}

export default Card
